import React from 'react';
import {Link} from 'react-router-dom';
import Signin from './pages/Signin';
const Navbar = () => {
    return (
        <nav>
            <div className="nav-wrapper">
                <Link to="/home" className="brand-logo">mYeat</Link>
                <ul id="nav-mobile" className="right">
                    <li><Link to="/signin" className="signin" >Sign In</Link></li>
                    <li><Link to="/signup">Sign Up</Link></li>
                    <li><Link to="/profile"><i class="large material-icons">account_circle</i></Link></li>
                </ul>
            </div>
            <div style={{color:"#2568FB",textAlign:"center",margin:"20px"}}>
                <h1 style={{color:"#2568FB",textAlign:"center",margin:"20px"}}>Welocome To mYeat</h1>
                <Signin/>
                <h5>Not a Registered User? <Link style={{background:"none",color:"#FECD45 !important"}} to="/signup">Sign Up</Link></h5>
            </div>
        </nav>
    );
}
export default Navbar;
